import React from "react";
import headerStyles from './header.module.css';

class Header extends React.Component {
    render() {
      return (
        <header className={headerStyles.header}>
        
        </header>
      );
    }
}

class Menu extends React.Component {
    render() {
      return (
        <nav className='menu'>
          {this.props.children}
        </nav>
      );
    }
  }
  
export default Header;
